import React from 'react';
import './styles/App.css';

const App: React.FC = () => {
  console.log('App component rendering'); // Debug log

  return (
    <div className="app" style={{ minHeight: '100vh', backgroundColor: '#0d1923' }}>
      <header className="app-header" style={{ padding: '20px' }}>
        <h1 style={{ 
          color: '#ffffff', 
          margin: 0,
          fontSize: '2.5em',
          textAlign: 'center' 
        }}>
          AWS Architecture Challenge
        </h1>
      </header>
      <main className="app-content" style={{ 
        padding: '20px',
        color: '#ffffff',
        textAlign: 'center'
      }}>
        <div>
          Test Content - If you can see this, basic rendering is working
        </div>
      </main>
    </div>
  );
};

export default App;
